import ExpenseItem from './ExpenseItem';
import './Expenses.css';

function Expenses(props) {
  const div = document.createElement('div');
  div.className = 'expenses';

  props.items.forEach(element =>
    div.append(
      <ExpenseItem
        title={element.title}
        amount={element.amount}
        date={element.date}
      />
    )
  );

  return (div);
}

export default Expenses;
